import './App.css';
import  React from "react"

import Header from"./Sectionfiles/Header"
import Nav from "./Sectionfiles/Nav"
import Main from "./Sectionfiles/Main"
import Footer from "./Sectionfiles/Footer"

function App() {
  return (
    <div className="App">
      <body>
     <React.Fragment>
      <Header></Header>
      <Nav></Nav>
      <Main></Main>
      <Footer></Footer>
     </React.Fragment>
      </body>
    </div>
  );
}

export default App;
